import { Box, Typography } from "@mui/material";

const header = () =>{
    return(
        <Box sx={{margin: "16px 0px;", display:'flex', justifyContent:'center', alignItems:'center', height:'100vh', opacity:0.6, flexDirection:'column',textAlign:'center'}}>
            <H1 sx={{fontSize:"24px", letterSpacing:'6px', fontFamily:'Raleway', margin:'10px 0', fontWeight:'400'}}>
                PHOTOGRAPHER
            </H1>
            <H1 sx={{fontSize:"36px", letterSpacing:'6px', fontFamily:'Raleway', margin:'10px 0', fontWeight:'400'}}>
                John Doe
            </H1>
        </Box>
    );
}

export default header
